    "2016-07-27T22:57:42.104501",nt"name": "shrub-scrub-habitat-evaluation",nt"isopen":
    false,nt"url": null,nt"notes": "Conversion of the current shrub-scrub habitats
    west of Sandpiper Road and north of the Back BayNational Wildlife Refuge, into recreational
    facilities for a new hotel development, should be avoideddue to the large number
    of negative impacts to local and migrating wildlife resources, the Back BayNational
    Wildlife Refuge, the Back Bay Watershed, the Town of Sandbridge, and the City of
    VirginiaBeach. Development of this Shrub-scrub habitat will result in, but not be
    limited to:u2022 Increased fragmentation of a unique habitat type in this area.u2022
    Disruption of avian migratory routes and traditional breeding areas.u2022 Local
    contribution to national and/or State declines of several songbird species.u2022
    Loss of several rare mammalian wildlife species already documented in this area.u2022
    Loss of a vegetative barrier and washover buffer that will lead to increased erosion,
    andpossible creation of a new saltwater inlet between the Atlantic Ocean and the
    fresh waters ofBack Bay.u2022 Increased recreational use, particularly personal
    watercraft, that will degrade the waterquality and Submerged Acquatic Vegetation
    (SAV) beds of Back Bay's sensitive ecosystem.u2022 Loss of an important migratory
    bird research and educational facility.",nt"license_title": "License Not Specified",nt"extras":
